  \"2015-01-22T15:57:55.745257\",\n\t\"name\": \"nsp-nic-reports\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NSP Investment Cluster (NIC) study
  analyzes how markets treated with a concentration of NSP investment have changed
  over time compared to similar markets that have only minimally or not been touched
  by NSP. These findings are then displayed in a series of maps and reports at the
  cluster level and at the grantee level. NIC cluster level maps and reports compare
  variables such as home sales, vacancies, demographic characteristics, and FHA lending
  and REO. NIC grantee reports provide a summary of NSP activity and NIC performance
  scores by activity. These tools can assist grantees and HUD in understanding how
  markets in which they are investing are changing over time, and how certain types
  of investment might affect NSP target areas.\",\n\t\"license_title\": \"License
